import styles from "./Onboarding.module.css";
import logo from "../img/Logo_2.png";

function Onboarding() {
  return (
    <div className={styles.Onboarding}>
      <div className={styles.logo_box}>
        <img src={logo} alt="logo" width={48} />
      </div>
    </div>
  );
}

export default Onboarding;
